import React, { Component } from 'react';
import Todo from './Todo';



class TodoList extends Component {
    constructor(props) {
      super(props);
      this.toDoListRemove = this.toDoListRemove.bind(this);
    }

    toDoListRemove(id) {
      //actual delete will happen in todoAPP
      this.props.toDoAppremoveTask(id);
    }

    render() {
      return React.createElement("ul", null, this.props.tasks.map(todo => React.createElement(Todo, {
        toDoListRemove: this.toDoListRemove,
        key: todo.id,
        todo: todo
      })));
    }

  }

